						["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
						["custom"] = "function(allstates, event, timestamp, subtype, ...)\n    \n    if type(allstates) ~= \"table\" then\n        return\n    end\n    \n    \n    local sourceGuid, sourceName = select(2, ...)\n    \n    if subtype ==\"SPELL_INTERRUPT\" then\n        \n        for i,k in pairs(allstates) do \n            if allstates[i].name and allstates[i].name==sourceName and (allstates[i].spellID==select(10, ...) or allstates[i].spellID==78675 and select(10,...)==97547) then\n                allstates[i].int=true\n                --Balance druid CD reduction on interrupt\n                if allstates[i].spellID == 78675   then                    \n                    allstates[i].expirationTime=allstates[i].expirationTime-15\n                    allstates[i].duration = allstates[i].duration-15\n                    allstates[i].changed = true\n                end\n                \n            end\n            \n        end\n        \n        \n        \n        \n        \n    end\n    \n    if subtype ==\"SPELL_CAST_SUCCESS\" then\n        \n        local spellId = select(10, ...)\n        \n        local cd=aura_env.cd[spellId]\n        if not cd then return end\n        --party/raid pets\n        if aura_env.pets[sourceGuid] ~= nil then\n            sourceName = aura_env.pets[sourceGuid]\n            --remove the line below to support everyones interrupts\n        elseif not( UnitInParty(sourceName) or UnitInRaid(sourceName)) then \n            return \n        end\n        \n        local class = select(2, UnitClass(sourceName));\n        local color = RAID_CLASS_COLORS[class]\n        \n        local state = {}\n        allstates[#allstates + 1] = state\n        state.color = color\n        state.show = true\n        state.changed = true\n        state.name = sourceName\n        state.progressType = 'timed'\n        state.duration = cd\n        state.expirationTime = GetTime() + state.duration\n        state.autoHide = true\n        state.resort = true\n        state.icon = select(3, GetSpellInfo(spellId))\n        state.spellID = spellId\n        \n        \n        \n        \n    end\n    \n    \n    return true\nend",
