			["customText"] = "function()\n    local c1 = \"\"\n    local c2 = \"\"\n    \n    if(not aura_env.state) then\n        return c1, c2\n    end\n    \n    -- Calculate time remaining if enabled and the animation has begun\n    if(aura_env.enableTimer == true and aura_env.state.animationStart == true) then    \n        c1 = (math.floor((aura_env.state.timeRemaining * 10^aura_env.fadeTimerDecimals) + 0.5) / 10^aura_env.fadeTimerDecimals)\n    end\n    \n    -- Return number of casts left if enabled\n    if(aura_env.enableRemainingCasts == true) then\n        c2 = aura_env.state.stacks\n    end\n    \n    return c1, c2\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["sparkRotationMode"] = "AUTO",
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_hide"] = "timed",
						["subeventSuffix"] = "_CAST_START",
						["use_specific_unit"] = false,
						["unit"] = "pet",
						["genericShowOn"] = "showOnActive",
						["names"] = {
						},
						["event"] = "Health",
						["custom"] = "function(allstates, event, timeStamp, subEvent, _, srcGuid, _, _, _, destGuid, _, _, _, spellId, spellName)\n    \n    if(event ~= \"COMBAT_LOG_EVENT_UNFILTERED\" or not timeStamp) then\n        aura_env.nImps = 0 -- counter can bug out so force it to 0\n        return 0\n    end     \n    \n    ----------------------------------\n    -- Check if tyrant is still active\n    ----------------------------------\n    if(aura_env.tyrantTimeStamp + aura_env.tyrantTimeout < timeStamp) then    \n        aura_env.tyrantActive = false\n    end\n    \n    \n    ---------------------------------------------------\n    -- Iterate through all imp's and check for timeouts\n    ---------------------------------------------------\n    local i, state, oldImp, oldTimeStamp\n    oldTimeStamp = aura_env.impTimeout\n    \n    -- Only iterate a few times per second\n    if(GetTime() >= aura_env.allstatesIterationPause + aura_env.iterationPauseTimeStamp) then\n        aura_env.iterationPauseTimeStamp = GetTime()\n        for i, state in pairs(allstates) do\n            if(state.show == true) then\n                \n                -- The imp's remaining duration\n                state.timeRemaining = state.duration - (timeStamp - state.timeStamp)\n                \n                -- Save oldest imp\n                if(state.timeRemaining < oldTimeStamp) then\n                    oldImp = state\n                    oldTimeStamp = state.timeRemaining\n                end  \n                \n                -- Check if imp's bar should start its text or fade animation            \n                if(state.animationStart == false and (state.timeRemaining  < aura_env.fadeTime)) then\n                    state.animationStart = true\n                end\n                \n                -- Check if it should stop its animation (because of tyrant)\n                if(state.animationStart == true and (state.timeRemaining >= aura_env.fadeTime)) then   \n                    state.animationStart = false\n                end\n                \n                -- Hide bar if imp times out. Create new event for the imp counter aura\n                if(state.timeRemaining < 0) then\n                    state.show = false\n                    state.changed = true\n                    \n                    aura_env.nImps = aura_env.nImps - 1\n                    WeakAuras.ScanEvents(\"IMP_COUNT_UPDATE\", aura_env.nImps)\n                end\n            end\n        end \n    end\n    \n    \n    ---------------\n    -- Imp summoned\n    ---------------\n    if(subEvent == \"SPELL_SUMMON\" and srcGuid == aura_env.player) then\n        if(spellName == \"Wild Imp\") then  \n            \n            -- Create sub table in allstates table\n            local state = {}\n            \n            -- State data\n            state.show = true\n            state.changed = true\n            state.key = destGuid\n            state.progressType = \"static\"\n            state.value = aura_env.impCasts\n            state.stacks = aura_env.impCasts\n            state.total = aura_env.impCasts\n            state.duration = aura_env.impTimeout\n            state.timeStamp = timeStamp          \n            state.index = -timeStamp\n            \n            -- Used in animation function\n            state.timeRemaining = aura_env.impTimeout\n            state.animationStart = false\n            \n            -- Imp's guid is the table key  \n            allstates[destGuid] = state\n            \n            -- Increment imp counter and create event for the imp counter aura\n            aura_env.nImps = aura_env.nImps + 1           \n            WeakAuras.ScanEvents(\"IMP_COUNT_UPDATE\", aura_env.nImps)            \n        end\n    end\n    \n    \n    ------------------------------------------------------------------\n    -- Imp casts a fel firebolt. Check if the imp belong to the player\n    ------------------------------------------------------------------\n    if(subEvent == \"SPELL_CAST_SUCCESS\" and allstates[srcGuid] ~= nil) then\n        state = allstates[srcGuid]\n        \n        -- If the imp only has 1 cast left it will still despawn with tyrant active(might be a bug)\n        if(not aura_env.tyrantActive or state.value == 1) then\n            state.value = state.value - 1\n            state.stacks = state.value\n        end\n        \n        -- Remove imp if it has no casts left. Also create an event for the imp counter aura\n        if(state.value == 0) then\n            state.show = false\n            \n            -- Decrement imp counter, create event for counter aura\n            aura_env.nImps = aura_env.nImps - 1   \n            WeakAuras.ScanEvents(\"IMP_COUNT_UPDATE\", aura_env.nImps)\n        end\n        state.changed = true\n    end   \n    \n    \n    ------------------------\n    -- Demonic Tyrant summon\n    ------------------------\n    if(subEvent == \"SPELL_CAST_SUCCESS\" and spellId == 265187 and srcGuid == aura_env.player) then\n        local i\n        \n        -- Check for Demonic Comsumption\n        if(select(4, GetTalentInfo(7, 2, 1))) then\n            for i, state in pairs(allstates) do    \n                state.show = false\n                state.changed = true\n            end\n            aura_env.nImps = 0        \n            WeakAuras.ScanEvents(\"IMP_COUNT_UPDATE\", aura_env.nImps)\n        else\n            -- All current imps are increased by 15 sec\n            for i, state in pairs(allstates) do\n                state.duration = state.duration + 15\n            end\n            \n            -- Remember when tyrant was cast\n            aura_env.tyrantActive = true\n            aura_env.tyrantTimeStamp = timeStamp\n        end\n    end\n    \n    \n    -----------------------\n    -- Implosion spell cast\n    -----------------------\n    if(aura_env.enableImplosion and subEvent == \"SPELL_CAST_SUCCESS\" and spellId == 196277 and srcGuid == aura_env.player) then   \n        -- Take note of how many imps to remove\n        aura_env.impImplodeQueue = aura_env.impImplodeQueue + aura_env.nImps\n    end\n    \n    -- Remove imploded imps from the queue one by one, with a pause in between to reduce lag.\n    if(aura_env.impImplodeQueue > 0 and GetTime() >= aura_env.implodePause + aura_env.implodePauseTimeStamp) then      \n        \n        -- Remove the oldest imp\n        if(oldImp) then           \n            oldImp.show = false\n            oldImp.changed = true\n            \n            -- Decrement n_imps and create event for the imp counter aura\n            aura_env.nImps = aura_env.nImps - 1\n            aura_env.impImplodeQueue = aura_env.impImplodeQueue - 1\n            aura_env.implodePauseTimeStamp = GetTime()\n            WeakAuras.ScanEvents(\"IMP_COUNT_UPDATE\", aura_env.nImps)\n        end \n    end\n    \n    \n    -- Make sure n imp's counter doesn't go below 0\n    if(aura_env.nImps < 0) then\n        aura_env.nImps = 0\n    end\n    \n    return true\nend",
