			["displayText"] = "%n",
			["customText"] = "function(expirationTime,rawDuration,progress,formatedDuration,name,icon,stacks)\n\nif aura_env.type~=\"cast\" and not WeakAuras.IsOptionsOpen() then\naura_env.region.bar:Hide()\naura_env.region.subRegions[4]:Hide()\nelse\naura_env.region.bar:Show()\naura_env.region.subRegions[4]:Show()\nend\n\nlocal spellstr,mobstr=strsplit(\">\",name)\n\naura_env.region.subRegions[2].text:SetText(mobstr)\nlocal txt1width=aura_env.region.subRegions[2].text:GetStringWidth()\naura_env.region.subRegions[3].text:SetText(spellstr)\nlocal txt2width=aura_env.region.subRegions[3].text:GetStringWidth()\nlocal txt2height=aura_env.region.subRegions[3].text:GetStringHeight()\nif aura_env.optionswidth then\naura_env.region:SetRegionWidth(oldwidth)\nend\n\nlocal wiwant,hiwant\nif aura_env.optionsWidth then wiwant=aura_env.optionsWidth else wiwant=aura_env.region.bar:GetWidth() end\nif aura_env.optionsHeight then hiwant=aura_env.optionsHeight else hiwant=aura_env.region.bar:GetHeight() end\nif txt1width>wiwant and txt1width>txt2width then\nif not aura_env.optionsWidth then\naura_env.optionsWidth = aura_env.region.bar:GetWidth()\nend\naura_env.region:SetRegionWidth(txt1width)\nelseif txt2width>wiwant and txt2width>txt1width then\nif not aura_env.optionsWidth then\naura_env.optionsWidth = aura_env.region.bar:GetWidth()\nend\naura_env.region:SetRegionWidth(txt2width+10)\nelse\naura_env.region:SetRegionWidth(wiwant)\nend\n\nif txt2height>hiwant then\nif not aura_env.optionsHeight then\naura_env.optionsHeight=aura_env.region.bar:GetHeight()\nend\naura_env.region:SetRegionHeight(txt2height)\naura_env.region.bar.spark:SetHeight(txt2height)\nend\nreturn mobstr,spellstr\nend",
