				["init"] = {
					["custom"] = "aura_env.mobcasts={}\naura_env.players={[\"Peachee-TheMaelstrom\"]=0,[\"Fatlife-TheMaelstrom\"]=1}\n\naura_env.playerAmount=2;\n\nname,realm=UnitFullName(\"player\")\naura_env.playerid=name..\"-\"..realm\naura_env.playerguid=UnitGUID(\"player\")\n\naura_env.lookingfor={[\"mob\"]=474,[\"cast\"]=13322,[\"marker\"]=8}\n\nlocal icon={\n    [0]=0,\n    [1]=1,\n    [2]=2,\n    [4]=3,\n    [8]=4,\n    [16]=5,\n    [32]=6,\n    [64]=7,\n    [128]=8\n}\nfunction aura_env:GetIcon(num)\n    if num==nil then num=0 end\n    return icon[num]\nend",
