						["custom"] = "function(allstates,event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID = ...\n        if subEvent == \"SPELL_AURA_APPLIED\" and (spellID == 306990 or spellID == 316847 or spellID == 316848) and select(6, strsplit(\"-\", destGUID)) == \"157439\" then\n            local expirationTime = select(6, WA_GetUnitBuff(\"boss1\", spellID))\n            if expirationTime then\n                aura_env.time = expirationTime\n            end\n        end\n        if subEvent == \"SPELL_AURA_REMOVED\" and (spellID == 306990 or spellID == 316847 or spellID == 316848) and select(6, strsplit(\"-\", destGUID)) == \"157439\"\n        and aura_env.time and math.abs(aura_env.time-GetTime()) > 0.1 then\n            local power = UnitPower(\"player\", 10) \n            if power and power < 100 then\n                allstates[destGUID] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = 3,\n                    expirationTime = 3 + GetTime(),\n                    autoHide = true,\n                }\n            end\n        end\n    end\n    return true\nend",
