			},
			["displayText"] = "%c",
			["customText"] = "function ()\n    if aura_env.config.settings.author[\"showTextAura\"] then \n        if WeakAuras.IsOptionsOpen() then\n            return ICON_LIST[8]..\":0|t [\"..GetUnitName(\"player\", true)..\"]\\n\"..ICON_LIST[7]..\":0|t [Bearbear-TwistingNether]\\n\"..ICON_LIST[6]..\":0|t [Fken-TarrenMill]\\n\"..ICON_LIST[5]..\":0|t [Zathyros-Ragnaros]\\n\"..ICON_LIST[4]..\":0|t [Moonrain-TarrenMill]\\n\"..ICON_LIST[3]..\":0|t [Onaj-Ragnaros]\"\n        end\n        return aura_env.state.icon..\" [\"..aura_env.state.name..\"]\"\n    end\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "event",
			["url"] = "https://wago.io/1ctv3b91K/8",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.instanceID = tostring(C_ChallengeMode.GetActiveChallengeMapID())\nif aura_env.config.settings.author.forceMapIdToggle then \n    aura_env.instanceID = tostring(aura_env.config.settings.author.forceMapIdValue)\nend\nC_ChatInfo.RegisterAddonMessagePrefix(\"MAM_EVENT\")\n\n\naura_env.markOrderListEnabled = aura_env.config.settings.useGenPrio\naura_env.getSeasonMob = {\n    [\"155434\"] = \"S3\", -- Emissary of the Tides\n    [\"155433\"] = \"S3\", -- Void-Touched Emissary\n    [\"155432\"] = \"S3\", -- Enchanted Emissary\n    [\"161244\"] = \"S4\", -- Blood of the Corruptor\n    [\"161510\"] = \"S4\", -- Mindrend Tentacle\n    [\"161243\"] = \"S4\", -- Samh'rek, Beckoner of Chaos\n    [\"161124\"] = \"S4\", -- Urg'roth, Breaker of Heroes\n    [\"161241\"] = \"S4\", -- Voidweaver Mal'thir\n}\n\nfunction createClone(allstates, name, guid, markID, CHAT_MSG_ADDON)\n    markID = tonumber(markID)\n    -- Create a clone\n    local state = {}\n    allstates[markID] = state\n    state.show = true\n    state.changed = true\n    state.name = name\n    state.progressType = 'timed'\n    state.expirationTime = GetTime() + 180\n    state.duration = 180\n    state.autoHide = true\n    state.guid = guid\n    state.icon = ICON_LIST[markID]..\":0|t\"\n    local msg = (\"SET_MARK:\"..markID..\":\"..guid..\":\"..name)\n    if not CHAT_MSG_ADDON then \n        -- Send a CHAT_MSG_ADDON EVENT\n        C_ChatInfo.SendAddonMessage(\"MAM_EVENT\", msg, \"PARTY\")\n        -- SETMARK : X : ICON : ACTIVE_TRUE : [NPCID]\n        SetRaidTarget(\"mouseover\", markID)\n        if aura_env.config.settings.author.debug then print(\"|cFF61AFD1SETMARK:|cFFD18C4C \"..markID..\" : \"..ICON_LIST[markID]..\"0:|t : ACTIVE_\"..tostring(allstates[markID].show)) end\n    end\nend",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["debuffType"] = "HELPFUL",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["custom_type"] = "stateupdate",
						["events"] = "UPDATE_MOUSEOVER_UNIT, CHAT_MSG_ADDON, PLAYER_ENTERING_WORLD, COMBAT_LOG_EVENT_UNFILTERED, PLAYER_REGEN_ENABLED, CHALLENGE_MODE_START",
						["spellIds"] = {
						},
						["names"] = {
						},
						["check"] = "event",
						["custom"] = "function(allstates, event, _, subEvent, ...)\n    -- Error checking\n    if type(allstates) ~= \"table\" then\n        return\n    end\n    if event == \"PLAYER_REGEN_ENABLED\" then \n        -- Player is out of combat, reset all marks.\n        for k,_ in pairs(allstates) do \n            allstates[k].changed = true\n            allstates[k].show = false\n        end\n    end\n    if event == \"CHAT_MSG_ADDON\" then \n        local prefix, msg = _, subEvent\n        local sender = select(2, ...)\n        -- If prefix isn't MPAM_EVENT return\n        if prefix ~= \"MAM_EVENT\" then return end\n        -- If the sender == player return. \n        if sender:find(UnitName(\"player\")) then if aura_env.config.settings.author.debug then print(\"|cFFFF0000DEBUG : |r|cFFFFFFFF\"..prefix..\" : SENT BY PLAYER : \"..sender..\"|r\") end return end\n        local subEvent, markID, guid, name = strsplit(\":\", msg)\n        if subEvent == \"SET_MARK\" then \n            -- Create a clone\n            createClone(allstates, name, guid, markID, true)\n        end\n    end\n    if event == \"PLAYER_ENTERING_WORLD\" or event == \"CHALLENGE_MODE_START\" then\n        if aura_env.config.settings.author.forceMapIdToggle then \n            aura_env.instanceID = tostring(aura_env.config.settings.author.forceMapIdValue)\n            return\n        end\n        -- Player has entered an instance. \n        -- Update instanceID\n        aura_env.instanceID = tostring(C_ChallengeMode.GetActiveChallengeMapID())\n        if aura_env.config.settings.author.debug then print(\"|cFF61AFD1\"..tostring(event)..\": |r|cFFD18C4CINSTANCEID : \"..aura_env.instanceID..\"|r\") end\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and subEvent == \"UNIT_DIED\" and aura_env.config[aura_env.instanceID] then\n        local guid = select(6, ...)\n        local npcID = select(6, strsplit(\"-\", guid))\n        if aura_env.config[aura_env.instanceID][npcID] then \n            if aura_env.config.settings.author.debug then print(\"|cFF61AFD1DDEBUG:|r|cFFD18C4CUNIT_DIED : [\"..npcID..\"] : IS IN NPCTABLE|r\") end\n            -- See if the mobs had a mark\n            for k,_ in pairs(allstates) do \n                if allstates[k].guid == guid and allstates[k].show then\n                    -- Dead unit had a mark, making it available again\n                    allstates[k].changed = true\n                    allstates[k].show = false\n                    break\n                end\n            end\n        end\n    end \n    if event == \"UPDATE_MOUSEOVER_UNIT\" and UnitExists(\"mouseover\") then\n        -- Unit has been marked, waiting for server to catch up. \n        for i = 1, #allstates, 1 do \n            if allstates[i] and UnitGUID(\"mouseover\") == allstates[i].guid then return end\n        end\n        -- Player is not in a dungeon\n        if not aura_env.config[aura_env.instanceID] then if aura_env.config.settings.author.debug then print(\"|cFF61AFD1DEBUG:|r|cFFD18C4C PLAYER NOT IN BFA INSTANCE|r [\"..aura_env.instanceID..\"]\") end return end\n        -- Unit is player\n        if UnitIsPlayer(\"mouseover\") then if aura_env.config.settings.author.debug then print(\"|cFF61AFD1DEBUG:|r|cFFD18C4C MOUSEOVER IS A PLAYER|r\") end return end \n        -- Unit is marked\n        if GetRaidTargetIndex(\"mouseover\") ~= nil then if aura_env.config.settings.author.debug then print(\"|cFF61AFD1DEBUG:|r|cFFD18C4C UNIT HAS MARK|r\") end return end\n        -- Grabbing some values\n        local guid = UnitGUID(\"mouseover\")\n        local npcID = select(6, strsplit(\"-\", UnitGUID(\"mouseover\")))\n        local name = UnitName(\"mouseover\")\n        local markID\n        -- Does the npcID exist in our table?        \n        if aura_env.config[aura_env.instanceID][npcID] or aura_env.config[aura_env.getSeasonMob[npcID]] then\n            -- Set the npcPath\n            local npcPath = aura_env.config[aura_env.getSeasonMob[npcID]] or aura_env.config[aura_env.instanceID]\n            \n            -- Get random markID\n            for i = 1, 8, 1 do \n                -- Get next Mark from available list\n                if allstates[i] == nil and aura_env.config.settings[\"useMarks\"][9-i] then \n                    markID = i\n                    break\n                end\n            end\n            -- Get the markID\n            for i = 1, 8, 1 do\n                local INVIDUAL_PRIO = \"P\"..i..\"-\"..npcID\n                local GENERAL_PRIO = aura_env.config.settings[\"prio\"..i]\n                -- Check if unit has individual prio mark\n                if i < 5 and npcPath[INVIDUAL_PRIO] ~= 1 and allstates[10-npcPath[INVIDUAL_PRIO]] == nil then \n                    markID = 10-npcPath[INVIDUAL_PRIO]\n                    break\n                end\n                -- Check if General Prio List\n                if aura_env.markOrderListEnabled and GENERAL_PRIO ~= 1 and allstates[10-GENERAL_PRIO] == nil and (npcPath[INVIDUAL_PRIO] == 1 or npcPath[INVIDUAL_PRIO] == nil) then\n                    markID = (10-GENERAL_PRIO)\n                    break\n                end\n            end\n            -- No mark was available, all marks are in use. Just return.\n            if not markID then \n                if aura_env.config.settings.author.debug then print(\"|cFF61AFD1DEBUG:|r|cFFD18C4C ALL MARKS ARE IN USE|r\") end\n                return \n            end\n            -- Create a clone\n            createClone(allstates, name, guid, markID, false)\n        end\n    end\n    return true\nend",
