				{
					["text"] = "|cFF61AFD1Mythic+ Auto Marking|r",
					["type"] = "description",
					["fontSize"] = "large",
					["width"] = 2,
				}, -- [1]
				{
					["text"] = "How does it work? When you mouseover a nameplate or creature the weakaura will put a raid mark on that mob if it's in the list below. I've now added a general prioritization list, the weakaura will then always choose the marks in the order that you set below(see |cFFf49e42settings|r). The only option that can bypass that order is the individual prioritization which I've now added up to four slots to. The order that it will try to mark in is the Individual prio (1,2,3,4) > General Prio (1,2,3...) > Random Mark. As usual if the raid mark is already taken(used on another mob) it will go to the next in line.\n\nAny questions, suggestions? Leave a comment on my wago page:",
