						["event"] = "Combat Log",
						["customStacks"] = "--Author Peachee-TheMaelstrom / Sectimus#2410\nfunction()\n    --print(\"loaded\")\n    \n    -- Main function to calc LS healing\n    \n    local now = time()\n    local heal_value = 0\n    -- Versa\n    \n    --Versatility rating\n    local VersatilityBonus = GetCombatRatingBonus(CR_VERSATILITY_DAMAGE_DONE) + GetVersatilityBonus(CR_VERSATILITY_DAMAGE_DONE)\n    -- Lazy:\n    VersatilityBonus = 1 + (VersatilityBonus/100)\n    \n    -- Min healing, 1% of maxhealth:\n    local MinHeal = (UnitHealthMax(\"player\")/100)*1\n    MinHeal = ((MinHeal * VersatilityBonus))\n    \n    -- Iterate through\n    for key, value in pairs(WA_TABLE) do\n        -- If the damage occured within the last 5 seconds,\n        -- assign it to the potential heal value.\n        \n        -- Yep, two of the same type of iteration.\n        if key > now-5 then\n            --print(\"yes\")\n            heal_value = heal_value + value or 0\n        else\n            --print(\"no\")\n            -- Otherwise, remove from table.\n            -- Else table is big.\n            WA_TABLE[key] = nil\n        end\n    end\n    \n    --print(\"vers = \"..VersatilityBonus)\n    --print(\"heal before = \"..heal_value)\n    \n    \n    \n    -- Heal is only 8% of damage taken, plus Versatility:\n    heal_value = ((heal_value/12.5) * VersatilityBonus)\n    -- Only output heal value if it's greater than MinHeal:\n    if heal_value < MinHeal then\n        heal_value = MinHeal\n    end\n    \n    -- Count how many souls are there\n    local name, _, count = aura_env.FindUnitAura(\"player\", 203981, \"HELPFUL\")\n    \n    local actualValue\n    if(name == \"Soul Fragments\") then\n        actualValue = heal_value*count\n        \n        --        print(\"fragments = \"..count)\n    else \n        actualValue = 0\n    end\n    \n    \n    --    print(\"heal after = \"..heal_value)\n    --    print(\"total = \"..actualValue)\n    --    print(\"-----\")\n    \n    return actualValue\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
