			["actions"] = {
				["start"] = {
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "--Author Peachee-TheMaelstrom / Sectimus#2410\naura_env.FindUnitAura = function(unit, spell, filter)\n    for i = 1, 40 do\n        local name, icon, count, debuffType, duration, expirationTime, unitCaster, isStealable, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, nameplateShowAll, timeMod, value1, value2, value3 = UnitAura(unit, i, filter)\n        if not name then return end\n        if spell == spellId or spell == name then\n            return name, icon, count, debuffType, duration, expirationTime, unitCaster, isStealable, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, nameplateShowAll, timeMod, value1, value2, value3, i\n        end\n    end\nend\n\naura_env.GetAbb = function(displayNum)\n    \n    old_displayNum = displayNum\n    local abb = \"\"\n    if displayNum >= 1000\n    then displayNum = displayNum/1000\n        abb = \"K\"\n    end\n    if displayNum >= 1000\n    then displayNum = displayNum/1000\n        abb = \"M\"\n    end\n    if displayNum >= 1000\n    then displayNum = displayNum/1000\n        abb = \"G\"\n    end\n    \n    local value = (\"%.2f%s\"):format(displayNum, abb)\n    \n    if abb == \"\"\n    then\n        return tonumber(string.format(\"%.\" .. (0) .. \"f\", displayNum))\n    else\n        \n        return value\n    end\nend\n\n\nfunction testfix()\n    WA_TABLE = {}\n    WA_GRELORNE_MAX_FR_VALUE = 2500000\n    WA_GRELORNE_DAMAGE_CAP_PER_SECOND = 1000000\n    --------------------------------------------------\n    -- Table to handle heal debuffs/buffs\n    WA_HEAL_BUFF_DEBUFF_TABLE = {}\n    \n    -- START Populate heal buff/debuff table\n    WA_HEAL_BUFF_DEBUFF_TABLE[\"Guardian of Elune\"] = 1.2\n    -- END Populate heal buff/debuff table\n    \n    --------------------------------------------------\n    -- Get Wildflesh artifact perk data.\n    -- Yes, this is the only way to do it. Blame Blizzard :)\n    WA_WILDFLESH_MULTIPLIER = 1\n    \n    local artifact = C_ArtifactUI\n    -- Is there an equipped artifact?\n    if HasArtifactEquipped() then\n        \n        local myArtifact = artifact.GetEquippedArtifactInfo()\n        -- Is it the Claws of Ursoc (itemid 128821)?\n        if myArtifact == 128821 then\n            \n            \n            -- Unregister opening of artifact\n            UIParent:UnregisterEvent(\"ARTIFACT_UPDATE\")\n            -- Open artifact\n            SocketInventoryItem(16)\n            \n            -- Iterate through perks\n            for i,p in ipairs(artifact.GetPowers()) do \n                local thisPower,_,currentRank = artifact.GetPowerInfo(p)\n                \n                -- If it's Wildflesh (spellid 200400)\n                if thisPower == 200400 then\n                    -- Multiplier is 5% * rank\n                    if currentRank == 0 then\n                        -- Do nothing    \n                    else\n                        WA_WILDFLESH_MULTIPLIER = 1 + ((currentRank*5)/100)\n                    end\n                    \n                end\n                \n            end\n            \n            -- Make sure the artifact is useable by the player\n            artifact.Clear()\n            UIParent:RegisterEvent(\"ARTIFACT_UPDATE\")\n        end\n    end\n    \n    return true\nend\n\n\n\ntestfix()\n\n\nfunction diminishing_returns(val, scale)\n    \n    if(val < 0) then\n        return -diminishing_returns(-val, scale);\n    end\n    local mult = val / scale;\n    local trinum = (math.sqrt(8.0 * mult + 1.0) - 1.0) / 2.0;\n    return trinum * scale;\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
