						["customDuration"] = "function()\n    print(aura_env.type)\n    if aura_env.type==\"cast\" then\n        duration=aura_env.castTime/1000\n        expiry=GetTime()+duration\n        return duration,expiry\n    else\n        return 2,GetTime()+2\n    end\nend",
						["customName"] = "function()\nif WeakAuras.IsOptionsOpen() then\n_,_,aura_env.icon=GetSpellInfo(282243)\nreturn \"|T\"..aura_env.icon..\":0|t\"..\"|cff59a3db[Apetagonize]|r > \"..ICON_LIST[8]..\"0|t\"..\"|cffea352eApetagonizer 3000|r\"\nelse\nlocal marker=\"\"\nif aura_env.marker~=0 and aura_env.marker~=nil then\nmarker=ICON_LIST[aura_env.marker]..\"0|t\"\nend\nif aura_env.type==\"cast\" then\nreturn \"|T\"..aura_env.icon..\":0|t\"..\"|cff59a3db[\"..aura_env.cast..\"]|r > \"..marker..\"|cffea352e\"..aura_env.name..\"|r\"\nelseif aura_env.type==\"interrupt\" then\nreturn \"|cff00EA0EInterrupted|r\"\nelseif aura_env.type==\"stolen\" then\nlocal stolenby=gsub(aura_env.stolenby,\"%-[^|]+\",\"\");\nlocal _,class=UnitClass(aura_env.stolenby)\nlocal _,_,_,colour=GetClassColor(class)\nreturn \"|cff00EA0EStolen by:|r \"..\"|c\"..colour..stolenby..\"|r\"\nelseif aura_env.type==\"died\" then\nreturn marker..\"|cffea352e\"..aura_env.name..\"|r\"..\" |cff00EA0Ehas died|r\"\nelseif aura_env.type==\"failed\" then\nPlaySound(926,\"Master\")\nreturn \"|cffFF0A0EMissed|r\"\nend\nend\nend",
						["custom"] = "function(caller,_,event,_,GUID,mobname,flags,marker,destGUID,_,_,destmarker,spellid,_,_,extraSpellId)\n    if event==\"SPELL_CAST_START\" or event==\"SPELL_INTERRUPT\" or event==\"SPELL_CAST_SUCCESS\" or (event==\"UNIT_DIED\" or event==\"UNIT_DESTROYED\" or event==\"UNIT_DISSIPATES\") then\n        local _,_,_,_,_,npcid=strsplit(\"-\",GUID)\n        npcid=tonumber(npcid)\n        local_,_,_,_,_,destnpcid=strsplit(\"-\",destGUID)\n        destnpcid=tonumber(destnpcid)\n        \n        local hostile=bit.band(flags,COMBATLOG_OBJECT_REACTION_HOSTILE)>0\n        if (event==\"SPELL_CAST_START\" and hostile) then\n            repeat\n                if aura_env.mobcasts[GUID] then\n                    if aura_env.mobcasts[GUID][spellid] then\n                        \n                        aura_env.mobcasts[GUID][spellid]=aura_env.mobcasts[GUID][spellid]+1\n                    else\n                        aura_env.mobcasts[GUID][spellid]=0\n                    end\n                else\n                    aura_env.mobcasts[GUID]={}\n                end\n            until aura_env.mobcasts[GUID][spellid]~=nil\n        end\n        \n        if (event==\"SPELL_CAST_START\" and\n            npcid==aura_env.lookingfor[\"mob\"] and\n            spellid==aura_env.lookingfor[\"cast\"])\n        then\n            \n            if (aura_env.mobcasts[GUID][spellid]%aura_env.playerAmount)==aura_env.players[aura_env.playerid]\n            then\n                aura_env.type=\"cast\"\n                aura_env.name=mobname\n                aura_env.spellid=spellid\n                aura_env.cast,_,aura_env.icon,aura_env.castTime=GetSpellInfo(aura_env.spellid)\n                aura_env.mobguid=GUID\n                \n                aura_env.isCasting=true\n                return true\n            end\n        elseif (event==\"SPELL_INTERRUPT\" and\n            destnpcid==aura_env.lookingfor[\"mob\"] and\n            extraSpellId==aura_env.lookingfor[\"cast\"] an